def hasGroupsSizeX(deck):
    """
    :type deck: List[int]
    :rtype: bool
    """
    import collections
    deck = collections.Counter(deck)
    res = []
    for temp in deck.items():
        res.append(temp[1])

    if min(res) == 1:
        return False

    base = min(res)
    for i in range(len(res)):
        if res[i] % base == 0:
            pass
        else:
            return False

    return True

